import React from 'react';
import Navbar from '../components/navbar/Navbar';
import './home.scss';


const Home = () => {
    return (
        <div className='home'>
            <Navbar />
            <img width='100%' src='https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg'/>
        </div>
    )
}

export default Home;
